import React from 'react'
import movieLogo from '../utils/images/movie-img.jpg'
import likeButton from '../utils/images/like-img.png'

const videoCard = () => {
  return (
    <div className="max-w-xs rounded overflow-hidden shadow-lg bg-gray-900 m-4">
    <img 
    classname="w-full h-40 object-cover object-centre"
    src={movieLogo} alt='Video Thumbnail'/> 
   
   <img className="w-50 h-10"
   src={likeButton} alt='Like Button'/>
   
    </div>
  )
}

export default videoCard;
